script: |
  super -f text -I q9430.spq | sort > q9430.out

inputs:
  - name: q9430.spq
    data: |
      SELECT col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE 97 + - - col1 * col1 - - 22 * + col2 NOT IN ( - col2, 37 + - col1 );
  - name: tab1

outputs:
  - name: q9430.out
    data: |
      59
      68
      96
